-- Дамп структуры для процедура Attraction.add_cash
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `add_cash`(
	IN `b_cash` DECIMAL(10,2),
	IN `b_bracer_id` INT





,
	IN `b_deposit_id` INT
)
BEGIN 
DECLARE old_cash DECIMAL(10,2); 

SELECT `cash` FROM `Attraction`.`deposit` 
WHERE `id`=b_deposit_id LIMIT 1 INTO old_cash;

INSERT INTO `Attraction`.`active_transactions` (`title`, `total_price`, `time`, `active_bracers_id`) 
VALUES ('Пополнение баланса', b_cash, SYSDATE(), b_bracer_id);

UPDATE `Attraction`.`deposit` SET `cash`=old_cash+b_cash
WHERE `id`=b_deposit_id; 
END//
DELIMITER ;

-- Дамп структуры для процедура Attraction.register
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `register`(
	IN `b_cash` DECIMAL(10,2),
	IN `b_bracer_number` INT,
	IN `b_tariff_id` INT

,
	IN `b_code` INT


,
	IN `b_tariff_price` DECIMAL(10,2)
)
    COMMENT 'Registers bracer'
BEGIN

DECLARE b_deposit_id INT;
DECLARE b_bracer_id INT;

INSERT INTO `Attraction`.`deposit` (`cash`) VALUES (b_cash);
SET b_deposit_id = LAST_INSERT_ID();

INSERT INTO `Attraction`.`active_bracers` (`code`, `bracer_number`, `deposit_id`, `tariff_id`) VALUES (b_code, b_bracer_number, b_deposit_id, b_tariff_id);
SET b_bracer_id = LAST_INSERT_ID();

INSERT INTO `Attraction`.`active_transactions` (`title`, `total_price`, `time`, `active_bracers_id`) 
VALUES ('Регистрация', b_tariff_price, SYSDATE(), b_bracer_id);

END//
DELIMITER ;

-- Дамп структуры для процедура Attraction.return_debt
DELIMITER //
CREATE DEFINER=`root`@`%` PROCEDURE `return_debt`(
	IN `b_deposit_id` INT,
	IN `b_bracer_id` INT,
	IN `b_cash` DECIMAL(10,2)


)
BEGIN
INSERT INTO `Attraction`.`active_transactions` (`title`, `total_price`, `time`, `active_bracers_id`) 
VALUES ('Гашение долга', b_cash, SYSDATE(), b_bracer_id);
UPDATE `Attraction`.`deposit` SET `cash`='0' WHERE  `id`=b_deposit_id;

